import {
  FeaturedImg,
  FeaturedInfo,
  StyledFeatured,
} from './styles/Featured.styed';

const Featured = () => {
  return (
    <StyledFeatured>
      <FeaturedImg
        src="https://images8.alphacoders.com/560/560736.jpg"
        alt="background image"
      />

      <FeaturedInfo>
        <img
          src="https://banner2.cleanpng.com/20180613/tjr/kisspng-logo-brand-line-font-interstellar-5b20e047573c62.9535050515288812233573.jpg"
          alt=""
        />
      </FeaturedInfo>
    </StyledFeatured>
  );
};

export default Featured;
